(13, 'القمح - الطحين', 'Wheat - flour', 'للقمح العديد من الفوائد الصحية المذهلة، وخاصةً عند تناول منتجات القمح المصنوعة من الحبوب￼￼￼￼\r\nالكاملة، وفيما يأتي أهم هذه الفوائد:\r\n\r\n1. زيادة طاقة وحيوية الجسم\r\n2. تحسين عمليات الايض والهضم وتعزيز صحة الامعاء\r\n3. الحماية من حصى المرارة\r\n4. تزويد الجسم من الالياف النافعة', 'Wheat has many amazing health benefits, especially when eating wheat products made from grains\r\ncomplete, and the following are the most important of these benefits:\r\n\r\n1. Increase the energy and vitality of the body\r\n2. Improving metabolism and digestion and promoting bowel health \r\n3. Protection from gallstones\r\n4. Providing the body with beneficial fibers', NULL, '2022-08-10 21:52:59', '2022-09-26 15:14:58', '/health_infos/1664180098قمح.jpg'),
(14, 'الزعتر', 'Thyme', '1- مضاد حيوي طبيعي\r\n2- مفيد للجهاز التنفسي\r\n3- مفيد للجهاز الهضمي 4- مكافح للأمراض السرطانية\r\n5- غني بالفيتامينات (فيتامين أ و ج و ب)', '1- A natural antibiotic\r\n2- Beneficial for the respiratory system\r\n3- Useful for the digestive system 4- Fighting cancerous diseases\r\n5- Rich in vitamins (vitamins A, C and B)', NULL, '2022-08-10 21:53:45', '2022-09-26 15:13:15', '/health_infos/1664179995زعتر.jpg'),
(15, 'النعناع', 'Mint', '1. السيطرة على اضطرابات المعدة ومتلازمة القولون العصبي\r\n2. السيطرة على تشنجات المريء\r\n3. يساعد في علاج حالات الصداع\r\n4. التخلص من رائحة الفم الكريهة\r\n5. التخفيف من انسدادالجيوب الأنفية والأعراض المصاحبة للبرد\r\n6. يخفف من الحساسية الموسمية\r\n7. تخفيف حالات الغثيان الناتج عن تلقي العلاج الكيميائي', '1. Control stomach disorders and irritable bowel syndrome\r\n2. Control of esophageal spasms\r\n3. Helps treat headaches\r\n4. Get rid of bad breath\r\n5. Reducing blocked sinuses and symptoms associated with a cold\r\n6. Relieves seasonal allergies\r\n7. Reducing nausea caused by chemotherapy', NULL, '2022-08-10 21:54:08', '2022-09-26 15:12:40', '/health_infos/1664179960نعناع.jpg'),
(16, 'السمسم', 'Sesame', '1. تنظيم ضغط الدم\r\n 2. المحافظة على صحة القلب\r\n3. تنظيم مستويات الهرمونات\r\n4. خفض مستويات الكولسترول\r\n5. محاربة الالتهابات\r\n6. محاربة السرطانات\r\n7. يعزز من فعالية أدوية السكري', '1. Regulating blood pressure\r\n  2. Maintain a healthy heart\r\n3. Regulating hormone levels\r\n4. Lower cholesterol levels\r\n5. Fight infections\r\n6. Fighting cancers\r\n7. Enhances the effectiveness of diabetes drugs', NULL, '2022-08-10 21:54:43', '2022-09-26 15:12:17', '/health_infos/1664179937سمسم.jpg'),
(17, 'البيض', 'Eggs with cheese', '1. غذاء متكامل للإنسان\r\n2. تحسين صحة الدماغ\r\n3. منع فقرالدم\r\n4. تحسين صحة الجنين تقوية العظام\r\n5. بناء العضلات\r\n6. تحسين صحة الجلد', '1. Complete food for man\r\n2. Improve brain health\r\n3. Prevent anemia\r\n4. Improving the health of the fetus, strengthening the bones\r\n5. Build muscle\r\n6. Improve skin health', NULL, '2022-08-29 22:58:13', '2022-09-26 15:11:56', '/health_infos/1664179916بيض.jpg'),
(18, 'زيت الزيتون', 'olive oil', '1. يعزز من صحة الأمعاء\r\n￼￼￼￼ 2. يعزز من صحة القلب والجهاز الدوراني\r\n 3. يقلل من خطر الإصابة بالسرطان \r\n4. يحمي الكبد \r\n5. يمنع الإصابة بالزهايمر', '1. Promotes gut health\r\n2. Promotes the health of the heart and circulatory system\r\n  3. Reduces the risk of cancer\r\n4. Protects the liver\r\n5. Prevents Alzheimer\'s disease', NULL, '2022-08-29 22:58:52', '2022-09-26 15:11:29', '/health_infos/1664179889زيت زيتون.jpg'),
(19, 'السبانخ', 'Spinach', '1. الوقاية من السرطان\r\n2. دعم جهازالمناعة\r\n3. تنظيم ضغط الدم\r\n4. الحفاظ على صحة جهاز الدوران\r\n5. تحسين الهضم\r\n6. الحفاظ على صحة العظام\r\n7. الوقاية منفقرالدم\r\n8. المساعدة في خسارة الوزن', '1. Cancer prevention\r\n2. Support the immune system\r\n3. Regulating blood pressure\r\n4. Maintain the health of the circulatory system\r\n5. Improve digestion\r\n6. Maintain bone health\r\n7. Prevention of anemia\r\n8. Helping lose weight', NULL, '2022-08-29 22:59:33', '2022-09-26 15:11:06', '/health_infos/1664179866سبانخ.jpg');
